	
	#sql to create and populate airport data
	DROP TABLE if exists airport;
	CREATE TABLE airport(id INT, state VARCHAR(30),identifier VARCHAR(30), city VARCHAR(30), name VARCHAR(100), size VARCHAR(10), cost DOUBLE, enplanements INT, dailyUsage INT, scaled INT,landingFee INT, runwayLength INT, timeZone INT,longitude DOUBLE,latitude DOUBLE, PRIMARY KEY(id));
	
